  private baseUrl:string;

  constructor(private http: Http) {
    this.baseUrl = './folders'
  }

  getFolders(searchOptions : SearchOptions, filter? : Folder) : Observable<{Folders:Folder[], TotalPages:number}> {
    // var response = this.http.post(this.baseUrl, {searchOptions:searchOptions, filter: filter})
    //.map((r) => r.json())
    console.log(searchOptions); 
    let takeSkipFolders = this.dummyData
    .sort((a, b)=>{
      let first = a[searchOptions.Sort.SortBy];
      let second = b[searchOptions.Sort.SortBy];

      if (first < second) {
        return searchOptions.Sort.Dir == SortDirection.Up ? -1 : 1;
      } else if (first > b) {
        return searchOptions.Sort.Dir == SortDirection.Down ? -1 : 1;
      } else {
        return 0;
      }
    }).slice(
      (searchOptions.pageNum - 1) * searchOptions.itemsCount, 
      searchOptions.pageNum * searchOptions.itemsCount
    );
    return Observable.create((obs: any) => {
      obs.next({Folders:takeSkipFolders, TotalPages: +(this.dummyData.length / searchOptions.itemsCount).toFixed(0)});
      obs.complete();
    });
    //return response;
  }

